-- Create settlements_streets table to replace large JSON file
-- This avoids loading 65MB of JSON data on every modal open
-- Data is now stored in PostgreSQL and fetched via API

DROP TABLE IF EXISTS childsmile_app_settlementsstreets CASCADE;

CREATE TABLE IF NOT EXISTS childsmile_app_settlementsstreets (
    city_name VARCHAR(255) PRIMARY KEY NOT NULL,
    streets JSONB NOT NULL DEFAULT '[]'::JSONB
);

-- Create index on city_name for faster lookups
CREATE INDEX IF NOT EXISTS idx_settlements_city_name ON childsmile_app_settlementsstreets(city_name);
----zzzzzzzzzzz
-- Update תל אביב-יפו to add missing street הרב אלנקווה
UPDATE childsmile_app_settlementsstreets 
SET streets = jsonb_insert(
  streets, 
  '{-1}', 
  '"הרב אלנקווה"'::jsonb
)
WHERE city_name = 'תל אביב - יפו'
AND NOT streets @> '"הרב אלנקווה"'::jsonb;

-- select to see all inserted
SELECT count(*) FROM childsmile_app_settlementsstreets;